class SubmissionStatus(Enum):
    UNPUBLISHED = "UNPUBLISHED"
    PENDING = "PENDING"
    PUBLISHED = "PUBLISHED"
    FAILED = "FAILED"

class SubmissionType(Enum):
    FABS = "FABS"
    DABS = "DABS"

