class Submission:
    def __init__(self, submission_id: str, submission_type: SubmissionType, agency: str, user_details: Dict):
        self.submission_id = submission_id
        self.submission_type = submission_type
        self.agency = agency
        self.user_details = user_details
        self.status = SubmissionStatus.UNPUBLISHED
        self.validation_errors = []
        self.flexible_fields = {}
        self.created_at = datetime.now()

    def update_status(self, status: SubmissionStatus) -> None:
        self.status = status
        logging.info(f"Submission {self.submission_id} status updated to {status.value}")

    def add_validation_error(self, error: str) -> None:
        self.validation_errors.append(error)
        logging.warning(f"Validation error added to submission {self.submission_id}: {error}")

    def get_validation_errors(self) -> List[str]:
        return self.validation_errors

    def add_flexible_field(self, key: str, value: Any) -> None:
        self.flexible_fields[key] = value
        logging.info(f"Flexible field added to submission {self.submission_id}: {key}={value}")

class ValidationService:
    def __init__(self):
        self.rules = {}

    def add_validation_rule(self, rule: ValidationRule) -> None:
        self.rules[rule.rule_id] = rule
        logging.info(f"Validation rule added: {rule.rule_id}")

    def validate_submission(self, submission: Submission) -> bool:
        logging.info(f"Validating submission {submission.submission_id}")
        is_valid = True
        for rule_id, rule in self.rules.items():
            if not rule.validate(submission.flexible_fields):
                submission.add_validation_error(rule.error_message)
                is_valid = False
        return is_valid

